She’s going to take that block and BATTER THE DORKTECTIVE OVER THE HEAD WITH IT 

While singing “Baby shark this you arse!”

@ECOPHAGYSPIDER Carnage. 

"You have to promise to help the innocent, not impede them. Assimilate the willing into the Rooks- and that doesn't mean assimilate them into you."

That should be enough. Hopefully. -

@SteamyPunkFrye - cover of her jacket, she let the claws on her right hand pierce her skin then retracted the blades. Her left thumb ran over the bloodied spots to check how quickly she healed. 

Slower than usual, but still miraculously fast.

"Who is the -

@SteamyPunkFrye "This is why I love you, your discretion, and snacks."

Slower to dress, she was polishing off the ginger ale and filling up on the carb-filled biscuits, then pushing nuts and dried fruit into her pockets for later. 

Finally dressed with buttoned up boots and ready to go.

@SteamyPunkFrye Bacon the Betrayer. 

Isn’t he thoughtful though? Her eyes peek open and there’s snacks on the nightstand and ginger ale. Perfect to let her stomach settle itself with before she gets out of bed. 

“What are we going to do today, Boss?”

@SteamyPunkFrye - in full working order and that everything he needed would be in the box (except the chemicals that he would already have anyway). So when he smiled, she was pleased. 

Kissing him back and hugging him. 

"Jacob, you are my Queen."

@CreedHeiress "Such as not leaving money in a plant pot for no reason?" 

She went there. 

"Jacob is very excited. He's worried, too."

@CreedHeiress Tea was being poured, again it was just the habit that seemed to happen here. Any excuse for tea. Perhaps it was to do with the heat. The houses were cold so the tea was a spot of warmth. 

"I'm pregnant."

No fancy announcement, just the plain fact that was probably not -

@SteamyPunkFrye - process. This camera was slightly different, it had four lenses and a shifting back. 

"It's a 4-tube Carte de Visite Wet Plate Camera, and it makes those little photographs that people keep on cards."

Not as sharp as tintypes, but fun. -

@SteamyPunkFrye "The clock adventure was part of your gift, but I wanted to get you something from me."

Because she knew that he would be inundated with hats, alcohol, weapons, and the like. So she'd chosen something that was more personal. 

Jacob was a -

@SteamyPunkFrye - walked back out?"

That was a game, Laura. 

"Do you want your birthday gift, Jacob?"

@IlvalainSairi - matter how impressive the serpent was, she herself was still an apex predator. 

"I will make sure they are healthy."

Nobody wanted to feed their pet something nasty like an opium addict.

@IlvalainSairi "I know. It's doing good things."

A snake. A very large snake. Laura eyed it with the same part of her brain that looked at small things with fur and categorised them into 'pet' or 'food'. She finally decided it was 'pet'. 

Because no -

@SteamyPunkFrye - repairman would take the full clock away when they could have used a ladder.

"I love the way the word tinkering rolled off your tongue. Made me wonder what else it could roll."

She knew he'd pick up her words through the carriage, his -

@IlvalainSairi - just everything. Everything smells bad. 

But.. she said she wasn’t going to companion. 

“Three Blighters, do you have a preference for body type? Little weasely ones, or big chunky ones? I can even find almost clever ones if you fancy a -

@SteamyPunkFrye - strength to catch it and not let it drop. 

She could also smell the prickle of interest from inside that meant someone had spotted them in an oh so casual observer manner. 

Giving him a grin, she popped a single claw from her right hand -

@JerusalemDai Finally it made sense, if he’d just led with that instead of the rest of his words. 

She nodded slowly. “I see.”

“You are still wrong about the Frye’s.” If that had been who he meant by ‘her lot’. “Family is important to them, and the -

@SteamyPunkFrye That got a little laugh from her.

“It was the one thing my Mother could do for me- read to me. Even if it was The Art Of War.” 

And an illicit copy of Pinocchio.

@SteamyPunkFrye "I can and I shall."

Because she had watched all the movies and could copy them from her favourite versions.

Once a plate of toast had been browned off, she sat herself down with the book open on her lap.

@StarLordOfDance “It also tastes good.”

“How are you?” 

She pulled back, just to peer at him.

@StarLordOfDance Wraps him in a hug, she smells a little pungent, nobody washes their outer garments here. 

“Thank you, Peter! And a Sprite?” 

Now she is pushing it.

@SteamyPunkFrye - the gilding is touched up, it’ll look amazing.”

Like she said, it was out in all weathers, so this was a rescue mission really. 

And she did appreciate the easier path. Especially once they were standing over the clock in question and -

@SteamyPunkFrye - she let her legs stretch out and hang down the slope of the roof with her heels catching on the lip of the tiles. Her hand gripping his. 

“That’s a good thing.”

A few more minutes until the feeling had passed then squeezed his hand. -

@JerusalemDai Sitting at least meant that the man was prepared to talk, and that at least was a positive. 

Laura sat, hands on her lap, ready to listen. 

Though her first instinct once he started his explanation was to say ‘Yes, I am not stupid’, she -

@JerusalemDai - after. Slowly. And probably much to the frustration of this assassin. 

“What if the organisation itself is compromising its own moral creed? Allowing innocents to die when it could help.”

“It could be argued that the brotherhood is -

@SteamyPunkFrye Standing on a rooftop with his arm around her waist, she kissed him back then nodded towards The King’s Head.

“Race you there?” 

It was one of those rare moments when he’d easily win if he put the effort in, but Laura was wearing a jacket that pulled up when she moved so -

@SteamyPunkFrye “That pub, The Kings Head on St George’s Road has a very nice clock just hanging outside in all weathers.” 

And History already said that it had been stolen. So—

“It would look lovely on the train...”

@SteamyPunkFrye “The rest will come later..”

A grin, then she took his hands and tugged him to the door.

“Let’s go run around like we own the place!”

@SteamyPunkFrye Once dressed for action, she was fine.  But she did pull him in for a kiss once they reached the kitchen. 

Jacob wasn’t big on sweets, so she had skipped baking a cake and instead bought him one of his favourite beigel’s and stuck a little candle in it.

“Happy Birthday, Jacob.”

@SteamyPunkFrye She knew that, she was amused her own imagination. 

“Let me try getting dressed then I’ll tell you if zip lines are a good idea or not.” 

She hoped she’d be fine, the idea of spoiling his day was not a nice one.

@SteamyPunkFrye “I know. But wow, was I mad when I woke up.” 

She laughed, then cuddled against him. 

“What do you want to do, birthday boy?”

@SteamyPunkFrye “There were three other things, but I can’t remember what they were.”

“I think you also showered while wearing a diaper.... a nappy?” 

“Anyway. Happy Birthday, my wonderful husband. I was going to make you breakfast, but I had a rough morning. Dinner tonight?”

@SteamyPunkFrye “I hated it, but it had its place. I was thinking of a school for anyone who needs it, and any who show interest in our more specialised fields, they can be coached.”

It was a starting point. And also a plan for the future.

She took his arm again, nodding towards the man who -

@SteamyPunkFrye barely spoke about it now. She had little to do with it beyond checking in every so often to make sure nothing untoward was happening.

“They were thinking of taking over one of the old orphanages in Whitechapel.”

“I was thinking of helping to raise funds.”

@CreedHeiress @PheonixFromDust "Generally, people only want confirmation that you care."

Though how that translated into gifts was up in the air. 

"There are five basic ways to show this; through words of affirmation, physical touch, acts of service, -

@SteamyPunkFrye - then--

"Race you!"

She sprang up and ran after the thief. Much like a guard dog, she did also enjoy the chase.

@SteamyPunkFrye - They are good on farms. And Canadian Geese are very good attack geese."

Really. 

Over on the path there was a scuffle that made Laura look up, someone was having their coin purse stolen. Laura sat up like a guard dog, gave him a smirk and -

@CreedHeiress @PheonixFromDust "For books and writing supplies we may need to find a shop, they don't sell those in this market."

Because very few in Whitechapel could read. 

"We can take a carriage to the book store--shop."

@PheonixFromDust It's convenient because a few sniffs as they walk reveal that @CreedHeiress is on her way to the same market. 

Laura nods towards the eastern corner of the market to find Freya, her arm slipping around her niece's arm. 

"Sunday shopping trip?"

@SteamyPunkFrye “What other plans?”

Work, probably. But that was a nasty word to use on a Sunday. 

“Picnic in the park? The one with the bands that play music maybe?”

@SteamyPunkFrye “Yes it is. Also being organised.” 

She squirmed on his lap to get comfortable, arm sliding around the back of his neck. 

“What are your plans for today?”

@EdenIsMilesAway “No, I am not sick. Just avoid the water and you will be fine.”

“And the broxy.” 

“And other sick people.”

@SteamyPunkFrye “I have... things....”

His face though, with those puppy dog eyes and that one eyebrow with the chunk missing out of it....

“....that I can totally delegate to others.”

@SleeplessSleuth Only taking the 'Merican's side cause Scottish and George was a prick. 

My dog speaks more eloquently than thee

But strangely, your mange is the same!

@SteamyPunkFrye Very good rules, though it probably helped if there was a handy gauge to show the pressure. Unfortunately humans lacked this.

"I won't be long, keep an apple for me to give to him."

Bribery, he'd also need a bath and that was Laura's job.

@SteamyPunkFrye There were a few blinks, and a few laughs, but mostly, they were used to this sort of nonsense by now and assumed that it was something to do with a mission. 

And really, she did need to learn how to drive a train. For reasons. 

She -

@SteamyPunkFrye Poses. 

“Toot-toot!” 

Chugga chugga chugga chugga!

@SteamyPunkFrye She appreciated that more than he could know, it wasn’t easy to have unlimited energy and be able to ignore a need for sleep, and then suddenly get tired out for no reason.  

And he was being very patient with it. 

She slid down and Motive filled her lap, padding and purring. -

@SteamyPunkFrye All part of her job, and duties as his adoring wife. 

Besides, he deserved her full support and backing. 

Time for him to go and party, it was only going to be an hour or possibly two before that first trimester tiredness kicked in and she was sliding up to him and whispering-

@CreedHeiress "The first time is supposed to put you off for a long time."

It builds character. 

"There will be tea there, and hot cider that has had the alcohol boiled off. Use your nose this time."

@CreedHeiress "I think you knew what you were drinking, Freya."

She laughed at that. 

"I manged to find the apple juice just fine."

@SteamyPunkFrye The thrill of that first time made her laugh out, elated as always when he carried her anywhere. 

In the carriage she sat close, head on his shoulder to make the most of the chance to rest before the next show. 

The Bonfire was set up and -

@SteamyPunkFrye - strategic planning for this has been flawless."

She was proud, and not afraid to say so. Turning to face him and pressing a kiss to his lips. 

"Here before you lies London, and here beside you stands Laura Frye. A clone from the future -

@SteamyPunkFrye - filled the night sky despite the smoke and the smog. More from other areas now joined in. 

Laura let her arm wrap around her husband.

"You deserve to be spoiled, my love. This show is all for you, a celebration of purging your city from -

@SteamyPunkFrye - then it started. 

Spread out over the city came the boom of explosives, all within a few seconds of each other much to Laura's pleasure. Yellow flame lighting up the sky for a moment as the explosives went off, smoke billowing up. 

The -

@SteamyPunkFrye - assessing risks. 

They had made it just in time. Her eyes could see the large clock tower easily, the minute hand reaching the summit of it's travels round the hour.

The first gong sounded from one direction as the clock stuck six and -

@IlvalainSairi @SteamyPunkFrye The mini-Rooks (Rook Juniors?) can stay. Laura will insist that she doesn’t need her nails painted, and will end up with nails and claws painted, on both hands and her feet.

Jacob can have the hair bows. 

Please send snacks.

@SteamyPunkFrye “Good mornernoonvening...” 

Whatever and whenever it was.

“Let’s stay here all day.”

@SteamyPunkFrye In her dream, she pretty much did buy the entire store.

Plus she’s woken up hot.

Which means the blanket gets kicked off and she’s going to pet his head instead.

@SteamyPunkFrye Sound asleep. On and off most of the night.

Morning is too early.

She is not getting up for her usual run, instead cuddling into his warm body from behind.

@TinyVoodooLady @AcolytesOfMine “Most father figures attempt that at least once.” 

“Lisa. It is a pleasure to meet you.”

The hand thing. Laura started at the hand for a moment before shaking it once.

@TinyVoodooLady @AcolytesOfMine “Hello. I do not know Jack, but he see,s obsessed with my husband, therefore he is a person of interest.” 

“He has still not told me your name, I am Laura.” 

She didn’t add that the woman smelled different. But it was noted.  Not human.  Not that it mattered.

@SteamyPunkFrye Sobs. 

“I’ll have to watch it in the bath.” 

Or read. Or whatever.

@SteamyPunkFrye "I hope they did. They deserve a celebration every so often."

Leaning back against him, she felt him sway then ad gusted her own balance.

"Time to head home? I'm tired now."

@SteamyPunkFrye Sniffles. 

Pretends it's to check the whereabouts of her pig.

But no sooner had Jacob dashed off, than someone was grabbing her arm for a dance.

@SteamyPunkFrye "Is this the start of the Great Frye Empire of Assassins? All wearing Top Hats and swaggering around the city like they own it."

Her hands slid up his arms, feet matching his rhythm.

It was a nice thought if she was honest.

@SteamyPunkFrye Jacob, no...

Eh. They start on the hard stuff around 8 in these days, who's she to judge?

"That is terrifying. Especially if they all have little hidden blades and try climbing everything they set their eyes on."

@SteamyPunkFrye aboard with empty sacks.

There was also a mini-rabble of children running up and down the carriages and being helped to jump over the couplings by an army in green. Seemingly they were being returned at Twilight.

It was those children who started to -

@SteamyPunkFrye Every blanket, rug and pillow they owned was now in the living room, piled on the floor in a comfy nest. 

The book was open, old and tatty but that added to the charm. 

“Biscuits? Mmm, they smell good.”

@SteamyPunkFrye “Will you massage my shoulders?”

“And rub my feet.” 

“And feed me peppermints?”

@SteamyPunkFrye The blood was fine, but the meat was almost enough to put her off her toffee apple. 

She took a nice deep sniff of her flowers, then stepped over a body to grip his arm.

"Oh yes, my flowers need water."

@SteamyPunkFrye Mouth busy on her toffee apple, her pulled her hand back and shook the claws, suddenly aware that there could be snot all over them. It made her follow her victim down, to wipe off his shirt.

Someone screamed. 

She said something about the hay fever.

@SteamyPunkFrye Two toffee apples? One was shoved in her pocket, the other held in her fee hand for her to start working on.

Now to kill two Blighters with a bouquet of flowers while eating a toffee apple with as little noise as possible.

He did get a kiss on the cheek though, just as one -

@SteamyPunkFrye her treat. 

Two red coats appearing over to the far left, by the butchery cart. 

Almost skipping over with her bouquet held up.

@SteamyPunkFrye Well she had asked and now he was throwing himself into action. 

The run was slower than usual, but they made it to the flower carts of the Spitfields Market. 

“I smell toffee apples...”

@SteamyPunkFrye “You would have loved video games, you know.”

She couldn’t help but laugh now, despite a sour belly. 

“The question is, have you ever used a bouquet of flowers to kill someone?”

@SteamyPunkFrye “Betrayal by bacon.”

Deep sigh. Actually it was a deep breath to try and relax her stomach. 

“Anyway, I’m going to be extra stabby to anyone who crosses me today, between that and the rain and Motive claiming my copy of Little Women.”

@SteamyPunkFrye She’d look super cute, and she did envy playing dress-up. Plus there’s that whole arresting the naughty assassin....

She needed a Bobby outfit. 

“Noodles tonight sounds amazing.”

@SteamyPunkFrye “Are you suggesting that I cut off this head for nothing?”

Maybe the casual way she carried a severed head around explained why some of those big brutes tended to avoid her. 

Her claws retracted, the head was placed down, idly wondering if it could go on a spike for Halloween.-

@SteamyPunkFrye - newly liberated factory overhearing. 

Finally she pulled away, holding up the head. 

“This is the old foreman, his right-hand man is still alive, he knows how to run the factory better than anyone else right now. I am hopeful that this -

@SteamyPunkFrye “I am highly productive today.” 

Producing a lot of blood flow.

It was her favourite thing — child liberation.

@SteamyPunkFrye Sigh. Cats.

Not that she was going to reclaim it, it’s not like it was bacon.

“Can we get blankets and pillows and camp out? I always think the dragon looks nice reflecting the flames.”

@SteamyPunkFrye Her arm slid around his neck, the other was stroking over his stubble, tracing one of the many scars he had. 

“What do you need?” 

It would have been sweet if his baby hadn’t chosen this moment to make himself known by stealing her toast off the plate and dragging it away.

@SteamyPunkFrye Oh her stomach was fine now, she was too lazy to bother cooking. Yesterday had been enough cooking for the week probably. 

“It’s Loco, Motive tried chasing a mouse and ran into a wall. He’s a little immature.”

Motive was one of those long haired cats that were bred for show.

@SteamyPunkFrye The laundry had been finished, all that ironing and folding and putting away, and she was curled up by the fire with a book.

Jacob got a grin, then the book was placed down so she could welcome him home with a kiss. 

"I'm fine, how are you?"

@CreedHeiress The cats ran off to do what cats do, that is to say that Loco ran off to hide from the two wild kittens. 

