“So, what is your news?”

@SteamyPunkFrye Touches her hand to her chest. 

“Be still my aching heart.” 

He gets a kiss, just before she starts prepping the food. Because her claws are sharper than the knives.

@SteamyPunkFrye She enjoyed sneaking, it was easy to do when you were rather short and slight enough the you could squeeze into small spaces. 

It also helped to be able to see in the dark.

Hearing him fight rather than seeing the action, she jumped once -

@SteamyPunkFrye “Vengeful Angel from on high. Got it.”

She broke into a sprint to the side, working her way to side of the building and climbing quickly with hand and foot claws to find a good entry spot.

She didn’t have Jacob’s Eagle vision, but she -

@SteamyPunkFrye - habit. A pistol was stashed in a back holster, but she never used it much. 

Once they were at the location, she stole a kiss for love and patted his rear for luck. 

“Where do you want me, Boss?”

@SteamyPunkFrye The other hand lies over her heart, she swoons a little. 

“Oh Mr Frye, I’d be honoured to murder alongside you.” 

Allows him to kiss her hand obviously, and then stows her wedding ring on its chain for safe-keeping.

