@SteamyPunkFrye “That part is very dull. But.. required.”

“I made you a hat sandwich.” 

All wrapped up in brown paper with an apple on top.

@SteamyPunkFrye - producer of medicines, good ones that won't make them sicker than they started. 

It's good work. 

But they get something else, a name. Someone who is already attempting to perfect a new poison.

@SteamyPunkFrye - this lightly. 

Jacob speaks, his smile is charming, she can smell the belief start to grow within this man. Belief in Jacob, in the Rooks, in a better world. 

She's honoured to see it in action. And by the end of it, the Rooks have a new -

