Or maybe its rats.

The man smelled of it now. -

@SteamyPunkFrye "I should warn you, I have a tendency to blurt out how it is done as soon as I spot it."

Which tended to annoy people. 

Hopefully a candied apple would keep her mouth busy so she wouldn't spoil too much of the show.

@OccultAshtray "It's very good, still missing indoor plumbing though."

"Not yet... but now I know that it'll go missing anyway, I think a clock would look amazing in the big warehouse." 

"How are you?"

@SteamyPunkFrye "With the power of my nice stockings?"

Easily. 

"Jacob Frye, make me a sandwich..."

@EdenIsMilesAway “Another time displaced Frye showed up. Jacob’s son.”

“Whether I am his Mother, or we adopt a child, it’s not something I ever thought possible. It would never have been safe for any child I had.” 

She’s not even embarrassed about it any more.

@EdenIsMilesAway “That works both ways, you know. I do not know as much about the Brotherhood as I should, and I suppose if I plan on staying here and producing new Assassins, I should find out more.”

“Let’s say that any and all exploitation should be eradicated.”

Simple plan. One still not -

@EdenIsMilesAway “But there are still others out there who contributed to the creation of The Facility. If I live long enough, I will find them all.”

“And I will stop anything here that looks like it might be heading in the same direction.” 

“I know you have the same plans.”

@EdenIsMilesAway The shrug was tight. This was always a sensitive subject. Her own past she had adcepted, but that of Gabby, Zelda and the others?

It burned.

“We destroyed the lab. Destroyed other embryos. I took a name that I hate so that they would know that their own creation killed them.” -

@EdenIsMilesAway This got dark quickly.

Her eyes flicked up.

“No. I was attempt 23. Sarah Kinney decided to make a female clone and grow it in her own uterus. They cloned me. I have sisters. Though there is a high degree of genetic variation as well as genetic manipulation. They were created -

@EdenIsMilesAway “They used to make me copy a hologram of the man I’m cloned from. They used that word. Synchronisation.”

“I did not fight like he did. Until I was male. Upper body strength. No foot claws.”

Word vomit.

@EdenIsMilesAway “A good night.”

She just felt.. like coffee wasn’t a good idea. But wasn’t about to share that.

“Did you ever spend time as a female, Desmond? In your past lives. I enjoyed being a male.”

@SteamyPunkFrye So he really had missed her?

Now she's tempted to slide out from under him and give him the run around. 

But her damn legs are wrapping themselves around his hips and her hand was sliding into his hair and cupping the back of his neck.

@SteamyPunkFrye There’s a crash as the glazed pitcher topples off the fireplace and smashes on the hearth.

“Jacob Frye, code name Rhino.” 

“Hello my darling.”

@SteamyPunkFrye “That’s why you have Rooks.”

Slides against him, letting him dip her and chuckling.

“Jacob, bring a mop and a bucket.”

@SteamyPunkFrye “That happens to me when I see your smile.”

Slips her arms on his shoulders and leans in for a kiss. 

“The smirking one that suggests you’re going to say something sarcastic.”

“Jacob, did I have wide child-bearing hips and large breasts?”

“Do you miss them?” 

