@SteamyPunkFrye - Like prey.

Until he stood towering over where the Assassin sat, the shadow was larger, shoulders wider. A hand pushed out for the bottle of whiskey.

"I get to hunt you all over again, Mr Frye,"

@SteamyPunkFrye "Are you playing coy again?"

That was called deflection, but her mind was wired differently. It wasn't doing the whole waiting thing, not that it ever did. 

He stood, stalking round the fire and keeping Jacob fixed in his line of sight. -

@SteamyPunkFrye Her eyes had rolled over to him, brown eyes rather than green but still holding the same hidden mirth that they often did around Jacob. 

“A little bit.”

As always, being in the great outdoors away from the city was relaxing. Laura had -

@SteamyPunkFrye Connie. The bay mare who knew that Laura-scent often meant sugar cubes, apples and carrots.

This time it was a carrot, half of which was munched before they got onto the wagon. 

He hadn’t spoken until they were outside of the city, she -

@SteamyPunkFrye - Just Jacob and a business associate. 

She’d have to make sure not to sit too close on the wagon. 

Laura was taking this well because she didn’t think it’d last too long.

@SteamyPunkFrye A bag had been packed full of warm but pretty clothes, including something she’d stitched herself. 

All of that was now pointless. Some of Jacobs undergarments were stuffed in on top and a hat shoved on top of his head. 

